import { Injectable } from '@angular/core';
import * as FileSaver from 'file-saver';
import * as XLSX from 'xlsx';

import * as pdfMake from 'pdfmake/build/pdfmake';
import * as pdfFonts from 'pdfmake/build/vfs_fonts';

const EXCEL_TYPE = 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;charset=UTF-8';
const EXCEL_EXTENSION = '.xlsx';
const PDF_EXTENSION = '.pdf';

@Injectable()
export class ExportService {
  constructor() { }
  public exportAsExcelFile(json: any[], excelFileName: string): void {
    const worksheet: XLSX.WorkSheet = XLSX.utils.json_to_sheet(json);
    const workbook: XLSX.WorkBook = { Sheets: { 'data': worksheet }, SheetNames: ['data'] };

    // Change Header of sheet
    const range = XLSX.utils.decode_range(worksheet['!ref']);
    for (let C = range.s.r; C <= range.e.r; ++C) {
      const address = XLSX.utils.encode_col(C) + '1'; // <-- first row, column number C
      if (!worksheet[address]) { continue; }
      worksheet[address].v = this.camalize(worksheet[address].v);
    }
    const excelBuffer: any = XLSX.write(workbook, { bookType: 'xlsx', type: 'array' });
    this.saveAsExcelFile(excelBuffer, excelFileName);
  }
  private saveAsExcelFile(buffer: any, fileName: string): void {
    const data: Blob = new Blob([buffer], { type: EXCEL_TYPE });
    FileSaver.saveAs(data, fileName + '_export_' + new Date().getTime() + EXCEL_EXTENSION);
  }

  private capitalize(string) {
    const str = string.replace('_', ' ');
    return str.charAt(0).toUpperCase() + str.slice(1).toLowerCase();
  }

  private camalize(string) {
    let str = string.replace(/([a-z])([A-Z])/g, '$1 $2');
    str = str.replace('_', ' ');
    let pieces = str.split(' ');
    pieces = pieces.map((word, index) => word.charAt(0)[index === 0 ? 'toLowerCase' : 'toUpperCase']() + word.toLowerCase().slice(1));
    str = pieces.join(' ');
    return str.charAt(0).toUpperCase() + str.slice(1);
  }

  public exportAsPdfFile(json: any, excelFileName: string) {

    pdfMake.vfs = pdfFonts.pdfMake.vfs;
    pdfMake.createPdf(json).download(excelFileName + '_export_' + new Date().getTime() + PDF_EXTENSION);
  }

  public exportAsTablePdfFile(json: any, excelFileName: string, paper?: string, rotePage?: boolean) {
    pdfMake.vfs = pdfFonts.pdfMake.vfs;
    const dd = {
      pageMargins: [30, 40, 30, 40],
      layout: 'headerLineOnly',
      pageSize: paper,  //'A4', 'A3' ...
      pageOrientation: (rotePage === true) ? 'landscape' : 'portrait',
      background: [{
        // tslint:disable-next-line: max-line-length
        image: 'data:image/jpeg;base64,',
        width: 150,
        alignment: 'right',
        margin: [0, 10, 20, 0]
      }],
      content: [
        { text: excelFileName, style: 'header' }
      ],
      footer: function (currentPage, pageCount) {
        return {
          stack: [{
            columns: [{},
            { text: currentPage.toString() + '/' + pageCount.toString(), alignment: 'center' },
            { text: (new Date()).toLocaleDateString(), alignment: 'right', margin: [0, 0, 40, 0] }]
          }]
        };
      },
      styles: {
        header: {
          fontSize: 18,
          bold: true,
          margin: [0, 0, 0, 10],
          color: 'red'
        },
        subheader: {
          fontSize: 16,
          bold: true,
          margin: [0, 10, 0, 5]
        },
        tableExample: {
          margin: [5, 5, 5, 15]
        },
        tableHeader: {
          bold: true,
          fontSize: 13,
          color: 'blue'
        }
      },
      defaultStyle: {
        // alignment: 'justify'
      }
    };
    dd.content.push(json);

    pdfMake.createPdf(dd).download(excelFileName + '_export_' + new Date().getTime() + PDF_EXTENSION);
  }

}
